VOID display(SpecialPoint *minus){
	printf("\n minus->Count = %d;\n", minus->Count);
	for (int i = 0; i < minus->Count;i++)
	{		
		printf("minus->minus[%d].x = %d;\n", i,minus->minus[i].x);
		printf("minus->minus[%d].y = %d;\n", i,minus->minus[i].y);
		printf("minus->minus[%d].direct = %f;\n",i, minus->minus[i].direct);
	}	
}

VOID saveImageDataToTxt(const Image *image, const char *filename)
{
    FILE *file = fopen(filename, "w");
    if (file == NULL)
    {
        printf("\n -- Cannot Open %s -- \n", filename);
        return;
    }

    for (int i = 0; i < image->Height; i++)
    {
        for (int j = 0; j < image->Width; j++)
        {
            fprintf(file, "%d", image->data[i][j]);
            if (i != image->Height - 1 || j != image->Width - 1)
                fprintf(file, ",");
        }
    }

    fclose(file);
}
VOID saveImageIscheckToTxt(const Image *image, const char *filename)
{
    FILE *file = fopen(filename, "w");
    if (file == NULL)
    {
        printf("\n -- Cannot Open %s -- \n", filename);
        return;
    }

    for (int i = 0; i < image->Height; i++)
    {
        for (int j = 0; j < image->Width; j++)
        {
            UINT8 gray = (image->isCheck[i][j] == 0) ? 255 : 0;
            fprintf(file, "%d", gray);
            if (i != image->Height - 1 || j != image->Width - 1)
                fprintf(file, ",");
        }
    }

    fclose(file);
}
void drawRedCircle(Image *image, int x, int y, int radius) {
    int i, j;

    for (i = x - radius; i <= x + radius; i++) {
        for (j = y - radius; j <= y + radius; j++) {
            if (i >= 0 && i < MaxWidth && j >=   0 && j < MaxHeight) {
                int dx = i - x;
                int dy = j - y;
                double distance = sqrt(dx * dx + dy * dy);
                if (distance <= (radius) && distance >= (radius-1)) {
                    int index = j * MaxWidth + i;
                    image->data[i][j] = 255;  // Đặt giá trị mức xám là 255 (màu đỏ)
                }
            }
        }
    }
}
VOID drawError( Image * image){
    for (int i = 0; i < image->Height; i++)
    {
        for (int j = 0; j < image->Width; j++)
        {
           if(image->isCheck[i][j] == 9 ||image->isCheck[i][j] == 8 ){
            drawRedCircle(image,i,j,3);
           }
        }
    }
}
VOID draw(SpecialPoint *minus, Image * image){
    for(int i = 0; i < minus->Count ;i++){
        drawRedCircle(image,minus->minus[i].y,minus->minus[i].x,3);
    }
}
VOID printfIscheck(Image *image){
    for(int i = 0; i < MaxWidth ; i++){
        for(int j = 0; j < MaxHeight; j++){
            if(j == 0){
                printf("%d",image->isCheck[i][j]);
            }else{
                printf("-%d",image->isCheck[i][j]);
            }
        }
        printf("\n");
    }
}
